import React, { Component } from 'react';
import User from './User';

export default class App extends Component {

    render() { 
        const btnStyle = {
            color: 'blue',
            backgroundColor: 'ora'
           
        }  
      
        return (
            <div>
                <button style={btnStyle}>Click Me</button>
            </div>
        );
               
                     
    }
}
